script: |
  super -f text -I q2962.spq | sort > q2962.out

inputs:
  - name: q2962.spq
    data: |
      SELECT DISTINCT + + 26 / col2 AS col0, col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( NOT NULL BETWEEN ( + + col2 ) + 31 AND - col1 * + + col1 / + col2 * - CAST ( - col0 AS INTEGER ) + + + col2 + - col1 ) );
  - name: tab1

outputs:
  - name: q2962.out
    data: |
